const profile=document.getElementById("profile"),goTo=()=>window.open("https://github.com/viniciustataide");profile.addEventListener("click",goTo);const print=document.getElementById("print"),sideMenuLeft=document.getElementById("side-menu-left"),contact=document.getElementById("contact"),hideMenu=()=>{sideMenuLeft.style.display="none",print.style.display="none",contact.style.display="block",window.print()},showMenu=()=>{contact.style.display="none",sideMenuLeft.style.display="block",print.style.display="block"};print.addEventListener("click",hideMenu),window.onafterprint=showMenu;